// import logo from './logo.svg';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import "./App.css";
import Header from "./components/Header";

function App() {
  return (
    <>
      <Router>
        <Header />

        <Switch>
          <Route path="/"></Route>
        </Switch>
      </Router>
    </>
  );
}

export default App;
